import React from "react";
import LandingPage from "../../LandingPage";
import { Link } from "react-router-dom";
import { tabControl } from "../helper";

const NavBar = ({
  setIsHome,
  setIsAbout,
  setIsProjects,
  setContent,
  content,
}) => {
  return (
    <div className="flex justify-between not-fancy-font text-white   text-25 mt-10 mb-8 gap-10 w-4/5">
      <div className="flex flex-col ml-8 gap-5 w-800">
        <Link to="/home">
          <button
            className="border-none bg-transparent"
            onClick={() =>
              tabControl(
                "home",
                setIsHome,
                setIsAbout,
                setIsProjects,
                setContent
              )
            }
          >
            Home
          </button>
        </Link>
        <Link to="/about">
          <button
            className="border-none bg-transparent"
            onClick={() =>
              tabControl(
                "about",
                setIsHome,
                setIsAbout,
                setIsProjects,
                setContent
              )
            }
          >
            About
          </button>
        </Link>
        <div>Projects</div>
      </div>
      <div className="ml-8 mt-10 mb-20">
        <LandingPage content={content} />
      </div>
    </div>
  );
};

export default NavBar;
